import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Number from "./Number.js";
import utils from "./utils.js";

const App = () => {
  let numberArr = utils.createArray;
  return (
    <>
      /*{" "}
      {numberArr.map(number => (
        <Number key={number} number={number} />
      ))}
      */
    </>
  );
};

export default App;
